  legacyGuidAsIfcGlobalId: 1rQ0i0qUuHuO00025QrE$V
localizations:
- language: de-DE
  name: 'Material - Holzbalken'
  definition: 'Dies ist eine Sammlung von mechanischen Eigenschaften, die auf Holzwerkstoffe für balkenförmige Produkte anwendbar sind, insbesondere laminierte Materialien wie Brettschichtholz und LVL.

    Anisotropy von solchen Materialien wird durch unterschiedliche Eigenschaften je nach Faserrichtung und Belastungsart berücksichtigt.



    All Werte sind für einen genormten Betriebszustand, eine genormte Belastungsdauer und eine genormte Bezugsgröße des Bauteils gemäß den örtlichen Konstruktionsvorschriften anzugeben.



    NOTE: In Fällen, in denen mechanische Materialeigenschaften für verschiedene vorgegebene Bezugsgrößen abgestuft werden, werden.'
